import './templatePage.css'
const TemplatePage = () => {
    const [select, setselect] = useState("")
    const input = useRef("")
//     const Clicked=()=>{

// input.current.value=E.current.value
//     }
    return (
        <>
           <div className='categoryDiv'>
               Select Category:
           </div>   
          <input ref={input} placeholder='Select Category'value={select} className="Selected"/>

            
          <div className='Choice'>
              <ul>
                  <li onClick={()=>setselect("E")}>E-Commerce</li>
                  <li>Blogs</li>
                  <li>Social</li>
                  <li>Education</li>
              </ul>
          </div>
        </>
    )
}

export default TemplatePage
